import { Button, TextField } from "@mui/material";
import { Box } from "@mui/system";
import React from "react";

const SignUp = ({
  setFirstName,
  setLastName,
  setEmail,
  setPassword,
  setConfirmPass,
}) => {

      console.log(setConfirmPass)
  return (
    <div>
      <Box>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            margin: "auto",
            width: "60%",
          }}
        >
          <TextField
            id="standard-basic"
            label="First Name"
            variant="standard"
            onChange={(e) => setFirstName(e.target.value)}
          />
          <TextField
            id="standard-basic"
            label="Last Name"
            onChange={(e) => setLastName(e.target.value)}
            variant="standard"
          />
          <TextField
            id="standard-basic"
            label="Email"
            variant="standard"
            onChange={(e) => setEmail(e.target.value)}
          />
          <TextField
            id="standard-basic"
            label="Password"
            variant="standard"
            onChange={(e) => setPassword(e.target.value)}
          />
          <TextField
            id="standard-basic"
            label="Confirm Password"
            variant="standard"
            onChange={(e) => setConfirmPass(e.target.value)}
          />
          <Button variant="contained" size="small" fullWidth>
            Create an account
          </Button>
        </div>
      </Box>
    </div>
  );
};

export default SignUp;
